import axios from "axios";

const getTestUser = async () => {
    axios("http://centerbeam.proxy.rlwy.net:22111/api/user")
        .then((res) => {
            console.log(res);
        })
        .catch((err) => {
            console.error(err);
        })
}

export default getTestUser;
